import React from "react";
import { Image, StyleSheet } from "react-native";

function ViewProductScreen(props) {
  return (
    <Image
      //   resizeMode="contain"
      style={styles.image}
      source={require("../assets/banana.jpg")}
    />
  );
}

const styles = StyleSheet.create({
  image: {
    height: "100%",
    width: "100%",
  },
});
export default ViewProductScreen;
